import React from 'react';
 const logo = {
      name: 'Zing MP3',
      avatarUrl: 'https://placekitten.com/g/64/64',
  };
function Logo() {
    return (
      <img
        className="Logo"
        src={logo.avatarUrl}
        alt={logo.name}
      />
    );
  }
 
  
export default Logo;
